INSERT INTO `rezepte` VALUES (28,'Tossed Salad With Green Goddess Dressing','<p>No matter what you\'re serving as the entrée, this salad will complement it wonderfully (or just top it with protein to be your main meal). It\'s filled with fresh vegetables, herbs, and a homemade dressing.</p>',1603908960,'Test Buch Link','Test Buch Author2',NULL,NULL),(31,'Herbes de Provence Shrimp with Basil and Pea Couscous','<p>Simply seasoned with Herbes de Provence (a mix of herbs including marjarom, oregano, lavender, rosemary and tarragon) this quick meal is served with a flavorful lemony pea couscous.</p>',1603908537,'Test link','Test author',NULL,NULL),(34,'Rajasthani Kadhi With Tofu','<p><strong>About Rajasthani Kadhi With Tofu Palak Pakoda Recipe</strong>: A tantalising kadhi recipe served with jeera pulao is what a hearty meal should be! This traditional Rajasthani kadhi recipe from Elior India serves crispy tofu palak pakoda along with it, and makes it all the more appetising and delicious!</p>',1604118849,'','',NULL,NULL),(35,'Paneer Thread Rolls Recipe','<p><strong>About Paneer Thread Rolls Recipe</strong>: Gorge on a fusion of Indo-Asian dish with cottage cheese cubes wrapped around cooked noodles and deep-fried to crispy best. Paneer thread rolls are an ideal snack to amp up your snacks table!</p>',1604652491,'','',NULL,NULL),(36,'My New Recipe for day','<p>My New Recipe for day</p>',1604849780,'','',NULL,NULL),(37,'Test','<p>Test</p>',1605288454,'','',9,NULL),(39,'admin receipe','<p>admin receipe</p>',1605289251,'','',5,_binary ''),(40,'Test','<p>sadasdasdsadas</p>',1605415511,'','',9,_binary '\0'),(41,'asdasd','<p>sadasd</p>',1605416888,'','',9,_binary '\0'),(42,'asdasd','<p>sadasd</p>',1605416898,'','',9,_binary '\0'),(43,'asdasd','<p>sadasd</p>',1605416912,'','',9,_binary '\0'),(44,'asdasd','<p>sadasd</p>',1605416999,'','',9,_binary '\0'),(46,'rrrrr','<p>rrrrrr</p>',1605417712,'','',9,_binary '\0'),(47,'Chicken masala recipe','<p><strong>Chicken masala recipe with video &amp; step by step photos</strong> – One of the most simple, home style Indian chicken recipe for beginners. This chicken masala goes great with rice, roti, naan or paratha. There are many many ways a masala chicken recipe is made across India. Each region has their own way of making it with locally available taste enhancers like coconut, cashews, sesame seeds, poppy seeds etc.</p>',1605629841,'','',5,_binary ''),(48,'Test Receipe','<p>Test Receipe</p>',1605628104,'','',9,_binary '\0');
